#define HOLE_RADIUS 2.0
#define M_PI 3.1415926535

float _2dNoise (vec2 forPos)
{
	float noiseVal = texture (iChannel0, forPos).r;
    return 0.9 + noiseVal * 0.1;
}

float fracSine (float inpZ)
{
    inpZ -= fract(inpZ);
    return abs(sin(fract (inpZ / 5.0) * 5.0));
}

float fracSineNoRepeat (float inpZ)
{
    float inpZ1 = inpZ;
    float inpZ2 = inpZ + 1.0;
    inpZ1 -= fract(inpZ1);
    inpZ2 -= fract(inpZ2);
    return mix (sin(inpZ1), sin(inpZ2), smoothstep (0.0, 1.0, fract(inpZ)));
}

float fBm (float angle)
{
	float amp = 0.5;
    float res = 0.0;
    for (int i = 0; i != 5;i++) {
        res += sin(angle) * amp;
        amp *= 0.5;
        angle *= 2.0;
    }
    return res;
}

float worldDensity (vec3 inpCoord)
{
    vec2 origDiff = inpCoord.xy - vec2 (cos(fracSineNoRepeat(inpCoord.z)), sin(fracSineNoRepeat(inpCoord.z)));
    vec2 uvDir = normalize (origDiff);
    float angle1 = acos (uvDir.x);
    float angle2 = angle1;
    angle1 *= 10.0 + 10.0 * fracSine (inpCoord.z + 12.0);
    angle2 *= 10.0 + 10.0 * fracSine (inpCoord.z + 1.0 + 12.0);
    float finalAngle = mix (angle1, angle2, fract (inpCoord.z));
    float wobbleAmount = fBm (finalAngle) * 0.1;
    return pow (max (1.0 - abs (length(origDiff + uvDir * wobbleAmount ) - HOLE_RADIUS), 0.0), 20.0);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy * 2.0 - 1.0;

    float timeScale = iTime * 0.5;
    vec3 curEye = vec3 (0.0, 0.0, timeScale);
    vec3 sampleDir = normalize (vec3 (uv, 1.0)) * 0.01 * _2dNoise (uv);
    vec3 samplePt = curEye + sampleDir;
    float scat = 1.0;
    vec3 finalColor = vec3 (0.0);

    for (float jj = 0.0;jj != 1.0;jj+=0.0) // Making an infinite loop work with Safari... *sigh*
    {
        float fader = max (15.0 - length (samplePt - curEye), 0.0)/ 15.0;
        float densityEval = worldDensity (samplePt);
        finalColor += scat * densityEval * fader * mix (vec3 (1.0, 0.0, 1.0),vec3 (0.0, 1.0, 1.0), fader);
        scat *= exp (-densityEval);
        if ( scat < 0.1 ) break;
        if ( fader == 0.0 ) break;
        samplePt += sampleDir;
    }

    // Output to screen
    fragColor = vec4(finalColor,1.0);
}
